import styled from "styled-components";
export {};
export const StyledLogo = styled.section`
  width: 20%;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  div {
    display: flex;
    img {
      height: 20px;
      width: 18px;
      left: 3px;
      top: 2px;
      border-radius: 0px;
    }
  }
`;
